<script>
export default {
  data() {
    return {
      counterthree: 3781,
      countertwo: 8341,
      show: false,
      counter: 7321,
      liked: false,
      favorite: false,
      inputValue: "",
    };
  },
  mounted(){
    this.scrollAmount = 320;
    this.currentScrollPosition= 0

    this.sCont = document.querySelector(".storys-container");
    this.hScroll = document.querySelector(".horizontal-scroll");
    this.btnScrollLeft = document.querySelector("#btn-scroll-left");
    this.btnScrollRight = document.querySelector("#btn-scroll-right");

    this.btnScrollLeft.style.opacity = "0";

    this.maxScroll = -this.sCont.offsetWidth + this.hScroll.offsetWidth;
  },
  methods: {
    scrollHorizontally(val) {
      this.currentScrollPosition += val * this.scrollAmount;

      if (this.currentScrollPosition >= 0) {
        this.currentScrollPosition = 0;
        this.btnScrollLeft.style.opacity = "0";
      } else {
        this.btnScrollLeft.style.opacity = "1";
      }

      if (this.currentScrollPosition <= this.maxScroll) {
        this.currentScrollPosition = this.maxScroll;
        this.btnScrollRight.style.opacity = "0";
      } else {
        this.btnScrollRight.style.opacity = "1";
      }

      this.sCont.style.left = this.currentScrollPosition + "px";
    },
    LikedButton() {
      this.liked = !this.liked;
    },
    FavoriteButton() {
      this.favorite = !this.favorite;
    },
  },

  watch: {
    liked: function (value) {
      if (value == true) {
        this.counter++;
        likedcon.classList.remove("far");
        likedcon.classList.add("fas");
        likedcon.style.color = "rgba(255, 0, 0, 0.863)";
      }
      if (value == false) {
        this.counter--;
        likedcon.classList.remove("fas");
        likedcon.classList.add("far");
        likedcon.style.color = "black";
      }
    },
    favorite: function (value) {
      if (value == true) {
        alert("Photo Added to Favorites");
        favoritecon.classList.remove("far");
        favoritecon.classList.add("fas");
      }
      if (value == false) {
        alert("Photo removed from Favorites");
        favoritecon.classList.remove("fas");
        favoritecon.classList.add("far");
      }
    },
    inputValue: function (value) {
      if (value == "") {
        ShareButton.style.cursor = "auto";
        ShareButton.style.color = "rgba(0, 145, 255, 0.364)";
      } else {
        ShareButton.style.cursor = "pointer";
        ShareButton.style.color = "rgb(0, 145, 255)";
      }
    },
  },
};
</script>
